import oracle.odi.domain.mapping.exception.MappingException
import oracle.odi.domain.model.OdiDataStore

public class ADWCBaseKM extends GroovyComponentGeneratorDelegateBase {

        protected MapPhysicalNode physicalNode;
        protected GeneratorContext generatorContext;

        protected String credName;
        protected String objStoreUser;
        protected String swiftPwd;

        protected Binding mBinding = null;

        public void setBinding(Binding binding) {

            super.setBinding(binding);
            mBinding = binding;

            Map variables = binding.getVariables();

            if (variables.containsKey("physicalNode")) {
              physicalNode =  mBinding.getVariable("physicalNode");
            }

            if (variables.containsKey("generatorContext")) {
              generatorContext =  (GeneratorContext) mBinding.getVariable("generatorContext");
            }

            String sourceSchemaName = getSourceSchemaName();

            credName = getOptionValue("CREDENTIAL_NAME");
            if (credName.contains("'") || credName.contains('"')) {
               throw new GenerationException("CREDENTIAL_NAME contains usupported characters : quotation marks")
            }
            binding.setVariable("credName", credName);

            // objStoreUser = '<%=odiRef.getDataServerPropertyFromLSchema( "User Name", "' + sourceSchemaName + '")%>';
            objStoreUser = '<%=odiRef.getDataServerProperty("User Name", "SRC")%>';
            binding.setVariable("objStoreUser", objStoreUser);

            // swiftPwd = '<%=odiRef.getDataServerPropertyFromLSchema( "Swift Password", "' + sourceSchemaName + '")%>';
            // swiftPwd = '<%=odiRef.getDataServerProperty( "Swift Password", "SRC")%>';
            swiftPwd = '<?=odiRef.getInfo("SRC_SWIFT_PASS")?>'
            binding.setVariable("swiftPwd", swiftPwd);
        }

        public String getOptionValue(String optionName) throws AdapterException, GenerationException, MappingException {
            return physicalNode.getOptionValue(IKnowledgeModule.ProcessingType.SOURCE, optionName).getOptionValueString();
        }

        MapPhysicalNode getSourceNode() {
            return getSourceNode(physicalNode);
        }

        MapPhysicalNode getSourceNode(MapPhysicalNode node) {
            List<MapPhysicalNode> sourceNodes = node.getUpstreamConnectedNodes();
            if (sourceNodes == null || sourceNodes.isEmpty()) {
                throw new RuntimeException("No source node");
            }
            MapPhysicalNode sourceNode = sourceNodes.get(0);
            return sourceNode
        }

        public String getSourceSchemaName() {
            return getSourceNode().getExecutionUnit().getLocation().getLogicalSchema().getName();
        }

        public String convertOptionToLoaderString(String optionName, String loaderProp) throws AdapterException, GenerationException, MappingException {
            def option = physicalNode.getOptionValue(IKnowledgeModule.ProcessingType.SOURCE, optionName);
            def loaderString = "";
            if (!option.isDefaultValue() || optionName.equals("DATE_FORMAT")) {
              loaderString = "'" + loaderProp + "' VALUE '" + option.getOptionValueString() + "'";
            }
            return loaderString
        }

        public List<String> getFormatPropsList () {

          def propMap = getFormatPropsMap ();
          def propsList = getFormatPropsList (propMap) ;
          return propsList;
        }

        public List<String> getFormatPropsList (def propMap) {
          def propsList = [];

          propMap.each {
             def prop = convertOptionToLoaderString(it.key, it.value);
             if (prop != "") { propsList.add(prop); }
          }
          return propsList;
        }

        public def getFormatPropsMap () {
          def propMap = [:];

          propMap['COMPRESSION'] = "compression";
          propMap['DATE_FORMAT'] = "dateformat";
          propMap['REJECT_LIMIT'] = "rejectlimit";
          propMap['CONVERSION_ERRORS'] = "conversionerrors";
          propMap['TRIM_SPACES'] = "trimspaces";
          propMap['IGNORE_BLANK_LINES'] = "ignoreblanklines";
          propMap['IGNORE MISSING COLUMNS'] = "ignoremissingcolumns";
          propMap['TRUNCATE_COLUMNS'] = "truncatecol";

          return propMap;
        }

        public List<String> getResourceList (String resourceName) {
           def resources = resourceName.split(",")
           def resourceList = []
           resources.each {resourceList.add(it.trim())}
           return resourceList
        }

        public SqlQuery createNewQueryForSelect(TemplateUtils templateUtils) {
          return new SqlQuery(templateUtils);
        }

        public List<ISelectItem> getSelectExprList(String tableAlias) {
          List<ISelectItem> result = new ArrayList<ISelectItem>();
          List<MapPhysicalColumn> cols = physicalNode.getPhysicalColumns();
          for (MapPhysicalColumn col : cols) {
            result.add(new StringExpression(col.getSQLAccessName(tableAlias), col, col.getRefObject()));
          }
          return result;
        }

        AbstractSyntaxTree buildUploadQuery (SqlQuery sqlQuery) {

            if (sqlQuery != null) {
              SqlQuery newQuery = sqlQuery.clone();

              def inputSelectList = sqlQuery.getSelectList();
              def newSelectList = [];
              def inputAliasList = sqlQuery.getAliasList();
              def newAliasList = [];

              def nodeAttributes = [];
              physicalNode.getPhysicalColumns().each {
                nodeAttributes.add(it.getReferencedAttribute())
              }

              if (inputAliasList != null) {
               for (i in [inputSelectList,inputAliasList].transpose()) {
                if (nodeAttributes.contains(i[0].getRefAttributeWithPath().getAttribute())) {
                   newSelectList.add(i[0]);
                   newAliasList.add(i[1]);
                }
               }
               newQuery.setAliasList(newAliasList);
              } else {
               for (i in inputSelectList) {
                if (nodeAttributes.contains(i.getRefAttributeWithPath().getAttribute())) {
                   newSelectList.add(i);
                }
               }
              }
              newQuery.setSelectList(newSelectList);
              return newQuery;
            } else {
              return sqlQuery;
            }
        }

        AbstractSyntaxTree buildUploadQueryDirect (SqlQuery sqlQuery) {

            if (sqlQuery != null) {
              SqlQuery newQuery = sqlQuery.clone();

              def inputSelectList = sqlQuery.getSelectList();
              def newSelectList = [];
              def inputAliasList = sqlQuery.getAliasList();
              def newAliasList = [];

              def nodeAttributes = [];
              physicalNode.getPhysicalColumns().each {
                nodeAttributes.add(it.getReferencedAttribute())
              }

              def targetAttributes = [];
              getTargetNode().getNodeAttributes().each {
                targetAttributes.add(it.getExpression().getReferencedObjects()[0])
              }

              if (inputAliasList != null) {
                targetAttributes.each {
                  for (i in [inputSelectList,inputAliasList].transpose()) {
                    if (it == i[0].getRefAttributeWithPath().getAttribute()) {
                      newSelectList.add(i[0]);
                      newAliasList.add(i[1]);
                    }
                  }
                }
                newQuery.setAliasList(newAliasList);
              } else {
                targetAttributes.each {
                  for (i in inputSelectList) {
                    if ( it == i.getRefAttributeWithPath().getAttribute()) {
                      newSelectList.add(i);
                    }
                  }
                }
              }

              newQuery.setSelectList(newSelectList);
              return newQuery;
            } else {
              return sqlQuery;
            }
        }

        String getResourceName(MapPhysicalNode node) {

            String resourceName = "";

            if (node.isAPNode()) {
              if (node.getLKM().getName().contains("LKM SQL to Object Storage")) {
                 resourceName = "odi_" + '<%=odiRef.getSession("SESS_GUID")%>_<%=odiRef.getStep( "NNO" )%>' + "_${node.getName()}.txt";
              }
            } else {
              if (node.getExecutionUnit().getExecutionTechnology().getName().equals("File") ||
                 node.getExecutionUnit().getExecutionTechnology().getName().equals("Oracle Object Storage")) {
                 OdiDataStore dataStore = (OdiDataStore)node.getLogicalComponent().getBoundObject();
                 resourceName = dataStore.getResourceName();
              } else {
                 resourceName = "odi_" + '<%=odiRef.getSession("SESS_GUID")%>_<%=odiRef.getStep( "NNO" )%>' + "_${physicalNode.getName()}.txt";
              }
            }
        }
 }


BEGIN
  dbms_cloud.create_credential(
    credential_name => '$[credName]',
    username => '$[objStoreUser]',
    password => '$[swiftPwd]'
  );
END;
